function gen_pw(e,t,n,r,i){"use strict";var s=[];for(var o=0;o<33;o++)s[s.length]=0;for(;o<48;o++)s[s.length]=i?1:0;for(;o<58;o++)s[s.length]=r?1:0;for(;o<65;o++)s[s.length]=i?1:0;for(;o<91;o++)s[s.length]=t?1:0;for(;o<97;o++)s[s.length]=i?1:0;for(;o<123;o++)s[s.length]=n?1:0;for(;o<127;o++)s[s.length]=i?1:0;s[s.length]=0;var u="";while(!test_pw(u,t,n,r,i)){u="";do{var a=Math.floor(Math.random()*128);if(s[a]==1)u+=String.fromCharCode(a)}while(u.length<e)}return u}function test_pw(e,t,n,r,i){"use strict";var s=false;var o=false;var u=false;var a=false;var f=/[A-Z]/;var l=/[a-z]/;var c=/[0-9]/;for(var h=0;h<e.length;h++){if(f.test(e[h]))s=true;else if(l.test(e[h]))o=true;else if(c.test(e[h]))u=true;else a=true}if(t==true&&s==false)return false;else if(n==true&&o==false)return false;else if(r==true&&u==false)return false;else if(i==true&&a==false)return false;else return true}